// SPDX-License-Identifier: MIT
pragma abicoder v2;
pragma solidity >=0.4.22 <0.9.0;

import "./Job.sol";

contract JobFactory {
    Job[] public jobs;

    struct Task {
        bytes32 digest;
        uint8 hashFunction;
        uint8 size;
    }

    function createAndEndow(
        Task[] memory _taskCids,
        string memory _jobType,
        string memory _jobName,
        string memory _jobDesc
    ) public payable returns (Job) {
        Job job = (new Job){value: msg.value}(_jobType, _jobName, _jobDesc);

        // for (uint256 i; i < _taskCids.length; i++) {
        //     bytes32 _digest = _taskCids[i].digest;
        //     uint8 _hashFunction = _taskCids[i].hashFunction;
        //     uint8 _size = _taskCids[i].size;
        //     job.newTask(_digest, _hashFunction, _size);
        // }

        jobs.push(job);
        return job;
    }

    function viewJobs() external view returns (Job[] memory) {
        return jobs;
    }
}
